(1, 'প্রস্তুতি শেষ না করেই টরন্টো ফ্লাইটের নতুন তারিখ দিল বিমান', 'প্রস্তুতি-শেষ-না-করেই-টরন্টো-ফ্লাইটের-নতুন-তারিখ-দিল-বিমান', 'ঢাকা-টরন্টো ফ্লাইট উদ্বোধনের ৯ সপ্তাহ পর এসে বিমান বাংলাদেশ এয়ারলাইনস জানাচ্ছে, ২৮ জুন কানাডার টরন্টোয় ফ্লাইট পরিচালনা শুরু করবে। গতকাল বুধবার সাংবাদিকদের সঙ্গে এক মতবিনিময় সভায় বিমানের ব্যবস্থাপনা পরিচালক (এমডি) নতুন এই তারিখের কথা জানান।\r\n                                এর আগে গত ২৬ মার্চ আগাম ঘোষণা দিয়ে টরন্টো ফ্লাইট উদ্বোধন করেছিল বিমান। কিন্তু প্রয়োজনীয় সব প্রস্তুতি সম্পন্ন না করেই ফ্লাইট চালুর ঘোষণা দেয়। ফলে উদ্বোধনী ফ্লাইটকে ‘পরীক্ষামূলক বাণিজ্যিক ফ্লাইট’ আখ্যা দিয়ে একটি ফ্লাইট ওই দিন আনুষ্ঠানিকতার মধ্য দিয়ে টরন্টো পাঠানো হয়। ওই ফ্লাইটের পেছনে খরচ হয়েছিল প্রায় চার কোটি টাকা।', NULL, NULL, 1, NULL, 1, 1, 0, NULL, '2022-10-06 10:07:40', '2022-10-06 10:07:40'),
(2, 'মহামারির মধ্যে দেশে করোনায় সর্বনিম্ন মৃত্যু মে মাসে', 'প্রস্তুতি-শেষ-না-করেই-টরন্টো-ফ্লাইটের-নতুন-তারিখ-দিল-বিমান', 'ঢাকা-টরন্টো ফ্লাইট উদ্বোধনের ৯ সপ্তাহ পর এসে বিমান বাংলাদেশ এয়ারলাইনস জানাচ্ছে, ২৮ জুন কানাডার টরন্টোয় ফ্লাইট পরিচালনা শুরু করবে। গতকাল বুধবার সাংবাদিকদের সঙ্গে এক মতবিনিময় সভায় বিমানের ব্যবস্থাপনা পরিচালক (এমডি) নতুন এই তারিখের কথা জানান।\r\n                                এর আগে গত ২৬ মার্চ আগাম ঘোষণা দিয়ে টরন্টো ফ্লাইট উদ্বোধন করেছিল বিমান। কিন্তু প্রয়োজনীয় সব প্রস্তুতি সম্পন্ন না করেই ফ্লাইট চালুর ঘোষণা দেয়। ফলে উদ্বোধনী ফ্লাইটকে ‘পরীক্ষামূলক বাণিজ্যিক ফ্লাইট’ আখ্যা দিয়ে একটি ফ্লাইট ওই দিন আনুষ্ঠানিকতার মধ্য দিয়ে টরন্টো পাঠানো হয়। ওই ফ্লাইটের পেছনে খরচ হয়েছিল প্রায় চার কোটি টাকা।', NULL, NULL, 1, NULL, 1, 1, 0, NULL, '2022-10-06 10:07:40', '2022-10-06 10:07:40');
