(12, 'Md Ibrahim Mizi', 'MBS', 'Accounting', '2020', 'rajuh1502@gmail.com', '1858086352', '/uploads/passport/1672451961.jpg', 'চাঁদপুর জেলার একটি সনামধন্য শিক্ষা  প্রতিষ্টান বলতে গেলে চাঁদপুর সরকারি কলেজের কথা বলতে হবে এই শিক্ষা প্রতিষ্ঠানে বহু দুর থেকে এবং চাঁদপুর জেলা ব্যতিত অন্য জেলা থেকে ও শিক্ষার্থী এসে শিক্ষা গ্রহন করেছে। আমাদের প্রানের ক্যামপ্রাশ চাঁদপুর সরকারি কলেজের ৭৫ বছর উদযাপনে\r\nএই অসংখ্য ছাএ/ছাএীদের মিলনমেলা আমরা অনেক আনন্দিত হবো।', '[\"\\/uploads\\/picture\\/1672451961.jpg\"]', '2022-12-30 19:59:21', '2022-12-30 19:59:21'),
