(14, 'ripon mahmud', 'Higher secondary', 'humanities', '15-16', 'riponalmahmud6@gmail.com', '01305935744', '/uploads/passport/1672930111.jpg', 'তিন চাকার বাহনে চাপিয়া এই মহা বিদ্যালয়ের সম্মুখ দিয়া যাইতেছিলাম। বাহির থেকে ইহার কারুকার্য প্রত্যক্ষ করিয়া বোধ করিলাম কোনো মহারজা কিংবা মহা পুরুষের প্রাসাদ হইব। প্রথম দুয়ার দিয়া প্রাসাদ অঞ্চলে প্রবেশ করিলাম। ও’মা এতো এক মহা বিদ্যাপীঠ। আমার মাধ্যমিক বিদ্যালয় অপেক্ষা ইহা মস্তবড়। আশ্চার্যান্বিত হইয়া গেলাম বিসাল আকৃতির কয়েক খানা প্রাসাদ দেখিয়া। অকস্মাৎ মাঠ অভিমুখে দৃষ্টি নিক্ষেপ হইলো। মাঠ খাণা অতিমাত্রায় বৃহত্তর। মাঠের উপরিভাগ তোলিয়া আছে সবুজ ঘাসের নিচে। মনেহইলো যেনো ইহার পৃষ্ঠদেশে কেউ সবুজ আবরণ দিয়া আচ্ছাদিত করিয়া রাখিয়াছে। সকলে বেশ আগ্রহনিয়া ঐ সবুজের উপরে বইসা আলাপচারিতায় মগ্ন। কি অপরুপ দৃশ্য। আহা জীবন সুন্দর। ভাবিলাম আমিও যদি সতীর্থদের সঙ্গে বইসা কথোপকোথন করিতে পারিতাম তবে মন্দ হইতো না। ক্ষণকাল পর আবার বিস্ময় অনুভব করিলাম, একি কান্ড এই ঘাস কি মৃত্তিকা শূন্য? যদি না হইয়া থাকে তাহইলে কেনো এই অবোধ ঘাস গুলোকে দলিত মথিত করিয়া তার উপরে শিক্ষাগ্রহণ কারীরা বইসা আছে। তারপর,অনেক দিন পর বোধগোম্য হইলো তাহারা এই ধূলোর স্পর্শে নিজেদেরকে শিক্ষানুরাগী করিয়া তোলে। বস্তুত ঐখানে তঁহারা পাঠ্যক্রমনিয়া আলোকপাত করিয়া থাকে।\r\nএক এক করিয়া এই বিদ্যাপীঠের সমস্ত নাজ নিয়ামত প্রত্যক্ষ করিতে লাগিলাম। নিজের অজান্তে দেহ মন আনন্দে আহ্লাদে আটখানা হইয়া গেলো। অতঃপর আবার আরেক বিস্ময়কর দৃশ্যের দিকে দৃষ্টি নিবদ্ধ হইলো। ভগ্ন প্রায় এক খানা ইটের ঘর দেখিলাম। ইহার দেয়াল ঘেষে সজীব হইয়া বাচিয়া আছে বন্যবৃক্ষ,গুল্ম লতাপাতা। বুজিলাম ইহা তাহাদের আদি নিবাস। ভগ্ন ঘরের সমীপে দেখিলাম একদল যুবা শৃঙ্ক্ষলার সঙ্গে দন্ডায়মান হইয়া আছে। তাঁহারা সকলেই একরকম বস্র পরিহিত। প্রত্যেকে তাঁহাদের বাহুতে ধারণ করিয়া রাখিয়াছে ঢাক, ঢোল, মাদল ইত্যাদী ধরণের বাদ্যযন্ত্র। তাঁহারা মনোযোগ সহকারে কি যেনো শ্রবন করিতেছে। একটু নিকটে গিয়া দেখিলাম একজন প্রধান গুরু যুবাদের দিকে মুখমন্ডল ফিরিয়া বিশেষ জ্ঞান শিক্ষা প্রদান করিতেছে। তাঁহার হস্তযুগল নানা ভঙ্গিতে সঞ্চালিত করে বক্তব্য পেশ করিতেছে। আমি অবাক দৃষ্টিতে চাহিয়া রহিলাম। গুরু ইঙ্গিত করিলে যুবাদের দলে মাদল বাজিল ঢাকে কাঠি দিয়া প্রহার করা আরম্ভ করিল। মাধুর্যসাদক বিশষ্ট ভঙির একখানা শব্দবিণ্যাস উৎপন্ন হইলো। অনুভব করিলাম শব্দের ভারে সমগ্র শিক্ষাঙ্গন যেনো কম্পিত হইয়া গেলো।\r\nঅল্পদূরে আরেকটি দল দেখিলাম তাঁহারা অন্য আরেক ঢঙ্গের বস্র পরিধান করিয়াছে। তাঁহাদের দলে কোনো সঙ্গিত সরাঞ্জম নাই। এরা বন্দুকধারী শিস্য। তাহদেরকেও একজন প্রধান গুরু দিক নির্দেশনা প্রদান করিয়া থাকে। গুরু ইঙ্গিত করিলে যুবা যুবতীরা রণকৌশল অনুশীলণ আরম্ভ করিয়া দেয়। আমার চোক্ষুতে ইহা সম্পূর্ণটাই নতুন। তাঁহারা তালে তালে পা ফেলিতেছে , অথচ কেহ চলে না , দলে না , টলে না যে যেইখানে দাঁড়াইয়া ছিল সে সেইখানে দাঁড়াইয়া তালেতালে পা ফেলিতে লাগিলো।\r\nদুই দলের গুরু উভয় দলের সম্মুখ ভাগে দন্ডায়মান হইয়া অম্বর ভেদী কন্ঠে “মহড়া” অরম্ভ করিলো, অমনি যুবারা সেই মহড়ার তালে তাঁহাদের রণকৌশল পুনঃপুনঃ অভ্যাস করিল। গুরুদ্বয়ের ধ্বনির ঢেউ নিকটের দালান কোঠায় গিয়া ভেধ করিতে লাগিল। সেই উৎসক উদ্দিপ্ত দৃশ্য দেখিয়া অশান্ত চিত্তকে সুস্থির করিয়া রাখা আমার পক্ষে দুঃসাধ্য হইয়া পড়িল। নিজেকে মনেহইলো বায়ুস্তরের উপরে ভাসমান হইয়া বিচরণ করিয়াছি। বিদ্যাপীঠের সম্পূর্ণ আঙ্গিনায় নবাগত হইয়া একটু পায়চারী করিলাম। ইহার অপরূপ দৃশ্য দেখিয়া বড়ই মুগ্ধ হইলাম।\r\nভর্তির সমস্ত আয়োজন শেষ হইলো। আজ হইতে এই মহাবিদ্যালয়ের একজন অনুগামী হইয়া নিজেকে অধিক ধন্য জ্ঞান করিলাম। ইহা মাধ্যমিত হইতে আপাদমস্তক ভিন্ন রকমের। এইখান কার শিক্ষাদাতাদের এক একটা আইডিয়ার দাম লক্ষ কোটি টাকা হইয়া থাকে। তাঁহাদের বক্ষস্থল বিশ্বসহিত্যের সর্বোৎকৃষ্ট রসে পরিপূর্ণ। একই সঙ্গে তাঁহাদের মস্তিস্কে ভর করিয়া আছে এনসাইক্লোপিডিয়ার মতো জ্ঞানের মহা আধার। তাঁহাদের শিক্ষাদানকাল ,কথা বার্তা এবং কালিকলমের খোচায় কখনোই কোনো ভ্রম থাকেনা। \r\nশিক্ষাদাতাদের সঙ্গে ক্রমে সুসম্পর্ক গঠন হইতে আরম্ভ করিল। তাঁহাদের সান্বিধ্যে আইসা মনেহইলো মাধ্যমিক উচ্চমাধ্যমিকের দুঃসহ বলয় হইতে মুক্তিপাইলাম। অসহ্য শাসনের মেয়াদ কাল উত্তীর্ণ হইলো বলে অনুমান করিতে সামান্য বিলম্ব হইলো না। এতোদিনের হৃদয় বেদনা নিমিশেই নাশ হইয়া গেলো। মহাবিদ্যালয়ের শিক্ষাদাতারা মাধ্যমিকের ন্যায় পিঞ্জর বানায় না। তাঁহারা শিক্ষার্থীদেরকে উম্মুক্ত অম্বরের জোগাড় করিয়া দেয়। বোধকরি যদি এ মহামানবদের পার্শ্বে আসিয়া না ঠেকিতাম তবে মনুষ্য জন্ম নিষ্ফল হইয়া থাকিত।\r\nদিন যত যাপন করিলাম এই বিদ্যাপীঠের শ্রী ততই দেখিতে লাগিলাম ,মুগ্ধ হইলাম। আর এজন্যেই পৃথিবীতে যত স্থান রহিয়াছে এই স্থান আমার সর্বাপেক্ষা প্রিয়। শিক্ষা জীবনের  পুরো সময় এই গৃহের ধারে কাটাইয়াছি । কাজেই জীবনের শেষ ক্ষনে আইসা কিংবা শ্রান্তির সময়ে এ গৃহ যদি হাত বাড়াইয়া আমাকে কোলে করিয়া না লয় তবে আর কে লইবে। বুদ্ধিহীন মনুষ্য হৃদয় লইয়া শেষকালে যখন পদার্পন করিব তখন এই নিকেতনের কথা,নিকেতনে গত হওয়া নন্দনিক মহূর্তের কথা স্মরণ করিয়া হৃদয় ভার হ্রাস করিব। এই ধ্যান করিয়া মহাবিদ্যালয়ের দিন গুলি অতিক্রান্ত করিতে লাগিলাম। এই বিদ্যানিকেতনের ছায়াতলে স্থান পাইয়া পরিমানে অধিক আরাম পাইলাম।', '[]', '2023-01-05 08:48:31', '2023-01-05 08:48:31'),
(15, 'ripon mahmud', 'Higher secondary', 'Humanities', '15-16', 'riponalmahmud6@gmail.com', '01305935744', '/uploads/passport/1672930281.jpg', 'তিন চাকার বাহনে চাপিয়া এই মহা বিদ্যালয়ের সম্মুখ দিয়া যাইতেছিলাম। বাহির থেকে ইহার কারুকার্য প্রত্যক্ষ করিয়া বোধ করিলাম কোনো মহারজা কিংবা মহা পুরুষের প্রাসাদ হইব। প্রথম দুয়ার দিয়া প্রাসাদ অঞ্চলে প্রবেশ করিলাম। ও’মা এতো এক মহা বিদ্যাপীঠ। আমার মাধ্যমিক বিদ্যালয় অপেক্ষা ইহা মস্তবড়। আশ্চার্যান্বিত হইয়া গেলাম বিসাল আকৃতির কয়েক খানা প্রাসাদ দেখিয়া। অকস্মাৎ মাঠ অভিমুখে দৃষ্টি নিক্ষেপ হইলো। মাঠ খাণা অতিমাত্রায় বৃহত্তর। মাঠের উপরিভাগ তোলিয়া আছে সবুজ ঘাসের নিচে। মনেহইলো যেনো ইহার পৃষ্ঠদেশে কেউ সবুজ আবরণ দিয়া আচ্ছাদিত করিয়া রাখিয়াছে। সকলে বেশ আগ্রহনিয়া ঐ সবুজের উপরে বইসা আলাপচারিতায় মগ্ন। কি অপরুপ দৃশ্য। আহা জীবন সুন্দর। ভাবিলাম আমিও যদি সতীর্থদের সঙ্গে বইসা কথোপকোথন করিতে পারিতাম তবে মন্দ হইতো না। ক্ষণকাল পর আবার বিস্ময় অনুভব করিলাম, একি কান্ড এই ঘাস কি মৃত্তিকা শূন্য? যদি না হইয়া থাকে তাহইলে কেনো এই অবোধ ঘাস গুলোকে দলিত মথিত করিয়া তার উপরে শিক্ষাগ্রহণ কারীরা বইসা আছে। তারপর,অনেক দিন পর বোধগোম্য হইলো তাহারা এই ধূলোর স্পর্শে নিজেদেরকে শিক্ষানুরাগী করিয়া তোলে। বস্তুত ঐখানে তঁহারা পাঠ্যক্রমনিয়া আলোকপাত করিয়া থাকে।\r\nএক এক করিয়া এই বিদ্যাপীঠের সমস্ত নাজ নিয়ামত প্রত্যক্ষ করিতে লাগিলাম। নিজের অজান্তে দেহ মন আনন্দে আহ্লাদে আটখানা হইয়া গেলো। অতঃপর আবার আরেক বিস্ময়কর দৃশ্যের দিকে দৃষ্টি নিবদ্ধ হইলো। ভগ্ন প্রায় এক খানা ইটের ঘর দেখিলাম। ইহার দেয়াল ঘেষে সজীব হইয়া বাচিয়া আছে বন্যবৃক্ষ,গুল্ম লতাপাতা। বুজিলাম ইহা তাহাদের আদি নিবাস। ভগ্ন ঘরের সমীপে দেখিলাম একদল যুবা শৃঙ্ক্ষলার সঙ্গে দন্ডায়মান হইয়া আছে। তাঁহারা সকলেই একরকম বস্র পরিহিত। প্রত্যেকে তাঁহাদের বাহুতে ধারণ করিয়া রাখিয়াছে ঢাক, ঢোল, মাদল ইত্যাদী ধরণের বাদ্যযন্ত্র। তাঁহারা মনোযোগ সহকারে কি যেনো শ্রবন করিতেছে। একটু নিকটে গিয়া দেখিলাম একজন প্রধান গুরু যুবাদের দিকে মুখমন্ডল ফিরিয়া বিশেষ জ্ঞান শিক্ষা প্রদান করিতেছে। তাঁহার হস্তযুগল নানা ভঙ্গিতে সঞ্চালিত করে বক্তব্য পেশ করিতেছে। আমি অবাক দৃষ্টিতে চাহিয়া রহিলাম। গুরু ইঙ্গিত করিলে যুবাদের দলে মাদল বাজিল ঢাকে কাঠি দিয়া প্রহার করা আরম্ভ করিল। মাধুর্যসাদক বিশষ্ট ভঙির একখানা শব্দবিণ্যাস উৎপন্ন হইলো। অনুভব করিলাম শব্দের ভারে সমগ্র শিক্ষাঙ্গন যেনো কম্পিত হইয়া গেলো।\r\nঅল্পদূরে আরেকটি দল দেখিলাম তাঁহারা অন্য আরেক ঢঙ্গের বস্র পরিধান করিয়াছে। তাঁহাদের দলে কোনো সঙ্গিত সরাঞ্জম নাই। এরা বন্দুকধারী শিস্য। তাহদেরকেও একজন প্রধান গুরু দিক নির্দেশনা প্রদান করিয়া থাকে। গুরু ইঙ্গিত করিলে যুবা যুবতীরা রণকৌশল অনুশীলণ আরম্ভ করিয়া দেয়। আমার চোক্ষুতে ইহা সম্পূর্ণটাই নতুন। তাঁহারা তালে তালে পা ফেলিতেছে , অথচ কেহ চলে না , দলে না , টলে না যে যেইখানে দাঁড়াইয়া ছিল সে সেইখানে দাঁড়াইয়া তালেতালে পা ফেলিতে লাগিলো।\r\nদুই দলের গুরু উভয় দলের সম্মুখ ভাগে দন্ডায়মান হইয়া অম্বর ভেদী কন্ঠে “মহড়া” অরম্ভ করিলো, অমনি যুবারা সেই মহড়ার তালে তাঁহাদের রণকৌশল পুনঃপুনঃ অভ্যাস করিল। গুরুদ্বয়ের ধ্বনির ঢেউ নিকটের দালান কোঠায় গিয়া ভেধ করিতে লাগিল। সেই উৎসক উদ্দিপ্ত দৃশ্য দেখিয়া অশান্ত চিত্তকে সুস্থির করিয়া রাখা আমার পক্ষে দুঃসাধ্য হইয়া পড়িল। নিজেকে মনেহইলো বায়ুস্তরের উপরে ভাসমান হইয়া বিচরণ করিয়াছি। বিদ্যাপীঠের সম্পূর্ণ আঙ্গিনায় নবাগত হইয়া একটু পায়চারী করিলাম। ইহার অপরূপ দৃশ্য দেখিয়া বড়ই মুগ্ধ হইলাম।\r\nভর্তির সমস্ত আয়োজন শেষ হইলো। আজ হইতে এই মহাবিদ্যালয়ের একজন অনুগামী হইয়া নিজেকে অধিক ধন্য জ্ঞান করিলাম। ইহা মাধ্যমিত হইতে আপাদমস্তক ভিন্ন রকমের। এইখান কার শিক্ষাদাতাদের এক একটা আইডিয়ার দাম লক্ষ কোটি টাকা হইয়া থাকে। তাঁহাদের বক্ষস্থল বিশ্বসহিত্যের সর্বোৎকৃষ্ট রসে পরিপূর্ণ। একই সঙ্গে তাঁহাদের মস্তিস্কে ভর করিয়া আছে এনসাইক্লোপিডিয়ার মতো জ্ঞানের মহা আধার। তাঁহাদের শিক্ষাদানকাল ,কথা বার্তা এবং কালিকলমের খোচায় কখনোই কোনো ভ্রম থাকেনা। \r\nশিক্ষাদাতাদের সঙ্গে ক্রমে সুসম্পর্ক গঠন হইতে আরম্ভ করিল। তাঁহাদের সান্বিধ্যে আইসা মনেহইলো মাধ্যমিক উচ্চমাধ্যমিকের দুঃসহ বলয় হইতে মুক্তিপাইলাম। অসহ্য শাসনের মেয়াদ কাল উত্তীর্ণ হইলো বলে অনুমান করিতে সামান্য বিলম্ব হইলো না। এতোদিনের হৃদয় বেদনা নিমিশেই নাশ হইয়া গেলো। মহাবিদ্যালয়ের শিক্ষাদাতারা মাধ্যমিকের ন্যায় পিঞ্জর বানায় না। তাঁহারা শিক্ষার্থীদেরকে উম্মুক্ত অম্বরের জোগাড় করিয়া দেয়। বোধকরি যদি এ মহামানবদের পার্শ্বে আসিয়া না ঠেকিতাম তবে মনুষ্য জন্ম নিষ্ফল হইয়া থাকিত।\r\nদিন যত যাপন করিলাম এই বিদ্যাপীঠের শ্রী ততই দেখিতে লাগিলাম ,মুগ্ধ হইলাম। আর এজন্যেই পৃথিবীতে যত স্থান রহিয়াছে এই স্থান আমার সর্বাপেক্ষা প্রিয়। শিক্ষা জীবনের  পুরো সময় এই গৃহের ধারে কাটাইয়াছি । কাজেই জীবনের শেষ ক্ষনে আইসা কিংবা শ্রান্তির সময়ে এ গৃহ যদি হাত বাড়াইয়া আমাকে কোলে করিয়া না লয় তবে আর কে লইবে। বুদ্ধিহীন মনুষ্য হৃদয় লইয়া শেষকালে যখন পদার্পন করিব তখন এই নিকেতনের কথা,নিকেতনে গত হওয়া নন্দনিক মহূর্তের কথা স্মরণ করিয়া হৃদয় ভার হ্রাস করিব। এই ধ্যান করিয়া মহাবিদ্যালয়ের দিন গুলি অতিক্রান্ত করিতে লাগিলাম। এই বিদ্যানিকেতনের ছায়াতলে স্থান পাইয়া পরিমানে অধিক আরাম পাইলাম।', '[]', '2023-01-05 08:51:21', '2023-01-05 08:51:21'),
